  display: flex;
  justify-content: center;
  align-items: center;
  background: $main-dark;
  border-radius: 24px;
  width: 232px;
  height: 44px;
  margin: 27px auto 20px;

  @include onDesktop {
    position: absolute;
    bottom: 20px;
    width: 207px;
  }

